import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { Alert, Platform, Pressable, StyleSheet, Text, TouchableHighlight, TouchableOpacity, View } from 'react-native';


const STATUS_BAR_HEIGHT = Platform.select({ios:20, android:24});

const HomeScreen = ({navigation}) => {
    const onClickFirst = () =>{
        navigation.navigate();
    }
    return (
        <View style={styles.container}>
            <View style={{ height: STATUS_BAR_HEIGHT}} />
        <View style={styles.topBarContainer}>
            <Pressable style={styles.pressableStyle} onPress={onClickFirst}>
                <Text style={styles.titleStyle}>Fridge</Text>
            </Pressable>
            <Pressable style={styles.pressableStyle}>
            <Text style={styles.titleStyle}>Shopping list</Text>
            </Pressable>
        </View>
        <View style={styles.mainContainer}>

        </View>
        </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: 'transparent',
    alignItems: 'center',
    justifyContent: 'center',
  },
  topBarContainer:{
      flex:1,
      backgroundColor:"transparent",
      justifyContent:"center",
      flexDirection:"row",
 },
 pressableStyle:{
     flex:1,
    alignItems:"center",
    justifyContent:"center",
    borderColor:"gray",
    borderWidth:1,
 },

 mainContainer:{
    flex:8,
 },
  titleStyle: {
    fontSize: 16,
    textAlign:'center',
  },
});
export default HomeScreen
